import axios from 'axios';
import React, { useEffect, useState } from 'react';

const ClaimDetails = () => {
  const [claimData, setClaimData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchClaimData = async () => {
      try {
        const response = await axios.get(`http://localhost:8080/claim/1`, {
          headers: {
            'Authorization': 'Basic VGVhbTE6VGVhbTE='
          }
        });
        setClaimData(response.data);
      } catch (err) {
        setError(err);
      } finally {
        setLoading(false);
      }
    };

    fetchClaimData();
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error.message}</div>;
  }

  return (
    <div>
      <h1>Claim Details</h1>
      {claimData ? (
        <div>
          <p><strong>Claim ID:</strong> {claimData.id}</p>
          <p><strong>Status:</strong> {claimData.status}</p>
          <p><strong>Description:</strong> {claimData.description}</p>
          {/* Add more fields as needed */}
        </div>
      ) : (
        <p>No claim data available.</p>
      )}
    </div>
  );
};

export default ClaimDetails;
